CREATE DEFINER=`root`@`localhost` PROCEDURE `get_count_all_status`(p_formdate datetime , p_todate datetime)
BEGIN
SELECT SUM(CASE WHEN os.id = 1 THEN 1 ELSE 0 END) AS 'Completed',
       SUM(CASE WHEN os.id = 2 THEN 1 ELSE 0 END) AS 'Cancel',
       SUM(CASE WHEN os.id = 3 THEN 1 ELSE 0 END) AS 'Wait for pay',
       SUM(CASE WHEN os.id = 4 THEN 1 ELSE 0 END) AS 'Delivery in progress',
       SUM(CASE WHEN os.id = 5 THEN 1 ELSE 0 END) AS 'Wait for confirmation',
       SUM(CASE WHEN os.id = 6 THEN 1 ELSE 0 END) AS 'Confirmed'
FROM datn_spring2023.order o
INNER JOIN datn_spring2023.order_status os ON o.order_status_id = os.id
WHERE o.create_date > p_formdate
  AND o.create_date < p_todate;
END ;;
