CREATE DEFINER=`root`@`localhost` PROCEDURE `get_top_product`(p_formdate datetime , p_todate datetime,p_top int,p_status int)
BEGIN
SELECT od.product_detail_id , sum(od.quantity) as 'Sum' FROM
datn_spring2023.order o join datn_spring2023.order_status os on o.order_status_id = os.id 
join datn_spring2023.order_detail od on od.order_id = o.id 
where 
o.create_date > p_formdate
and o.create_date < p_todate
and os.id = p_status
group by od.product_detail_id
order by Sum desc
limit p_top;
END ;;
